//# sourceMappingURL=ol.js.map
;
var mapObject = {

  countryHightlightLayer : new ol.layer.Vector({
    source: new ol.source.Vector(),
    map: this.map,
    style: function(feature) { var toRet = new ol.style.Style({
      stroke: new ol.style.Stroke({
        color: '#ff9d2d',
        width: 2
      }),
      fill: new ol.style.Fill({
        color: 'rgba(256,157,45,0.5)',
      }),
      text: new ol.style.Text({
        font: '12px Calibri,sans-serif',
        fill: new ol.style.Fill({
          color: '#fff'
        }),
        stroke: new ol.style.Stroke({
          color: '#000',
          width: 3
        })
      }),
    });
    toRet.getText().setText(feature.get('name'));
    return toRet;}
  }),

  countryLayer : new ol.layer.Vector({
    source: new ol.source.Vector({
      url: 'assets/countries.json',
      format: new ol.format.GeoJSON()
    }),
    style: function(feature) {
      mapObject.countryStyle.getText().setText(feature.get('name'));
      return mapObject.countryStyle;
    }
  }),

  markerLayer : new ol.layer.Vector({
    source: new ol.source.Vector(),
    style: new ol.style.Style({
      image: new ol.style.Icon({
        anchor: [11, 29],
        anchorXUnits: 'pixels',
        anchorYUnits: 'pixels',
        opacity: 1,
        src: '/assets/marker.png'
      })
    }),
  }),

  markerHoldingLayer : new ol.layer.Vector({
    source: new ol.source.Vector(),
    style: new ol.style.Style({
      image: new ol.style.Icon({
        anchor: [11, 29],
        anchorXUnits: 'pixels',
        anchorYUnits: 'pixels',
        opacity: 1,
        src: '/assets/marker.png'
      })
    }),
  }),

  map : {},

  initMap : function() {

    $("#map").empty();

    mapObject.popup = new ol.Overlay({
      element: document.getElementById('popup')
    });

    mapObject.YearSelectorControl.prototype = Object.create(ol.control.Control.prototype);
    mapObject.YearSelectorControl.prototype.constructor = mapObject.YearSelectorControl;

    mapObject.YearSelectorControl.prototype.handleYearSelection = mapObject.handleYearSelection;

    mapObject.map = new ol.Map({
      controls: ol.control.defaults().extend([
        new mapObject.YearSelectorControl(this.yearSelector)
      ]),
      target: 'map',
      layers: [
        /*new ol.layer.Tile({
          source: new ol.source.OSM()
        }),*/
        mapObject.countryLayer,
        mapObject.countryHightlightLayer,
        mapObject.markerLayer
      ],
      overlays: [mapObject.popup],
      view: new ol.View({
        center: ol.proj.fromLonLat([10, 20.3]),
        zoom: 2.5,
      })
    });
    $.getJSON('/organizations.json?without_paging=true', function(organizations) {
      organizations.forEach(function(o) {
        o.offices.forEach(function(of) {
          var featureCoordinate = ol.proj.transform([of.lon, of.lat],'EPSG:4326','EPSG:3857');
          var iconFeature = new ol.Feature({
            id: o.id,
            coordinate: featureCoordinate,
            geometry: new ol.geom.Point(featureCoordinate),
            name: o.name,
            website: o.website,
            when_endorsed: o.when_endorsed.substr(0,4),
            countries: o.countries,
            sectors: o.sectors
          });
          mapObject.markerLayer.getSource().addFeature(iconFeature);
        });
      });
    });
    mapObject.map.on('click', mapObject.clickHandler);
  },

};
mapObject.countryHighlightStyle = new ol.style.Style({
  stroke: new ol.style.Stroke({
    color: '#ff9d2d',
    width: 2
  }),
  fill: new ol.style.Fill({
    color: 'rgba(256,157,45,0.5)',
  }),
  text: new ol.style.Text({
    font: '12px Calibri,sans-serif',
    fill: new ol.style.Fill({
      color: '#fff'
    }),
    stroke: new ol.style.Stroke({
      color: '#000',
      width: 3
    })
  }),
});

mapObject.countryStyle = new ol.style.Style({
  fill: new ol.style.Fill({
    color: 'rgba(45,115,199, 0.5)',
  }),
  stroke: new ol.style.Stroke({
    color:   'rgba(45,115,199, 1.0)',
    width: 2
  }),
  text: new ol.style.Text({
    font: '12px Calibri,sans-serif',
    fill: new ol.style.Fill({
      color: '#fff'
    }),
    stroke: new ol.style.Stroke({
      color: '#000',
      width: 3
    })
  }),
});
mapObject.yearSelector = document.createElement('select');

mapObject.YearSelectorControl = function YearSelectorControl(selectElement) {
    var yearHTML = '<option value="All">All Years</option>';
    for (var iy = 2015; iy <= new Date().getFullYear(); iy++) {
      yearHTML += '<option value="' + iy + '">' + iy + '</option>'
    }
    selectElement.innerHTML = yearHTML;
    selectElement.className = "custom-select"

    var element = document.createElement('div');
    element.className = 'float-right';
    element.appendChild(selectElement);

    ol.control.Control.call(this, {
      element: element,
      target: 'map',
    });

    selectElement.addEventListener('change', this.handleYearSelection.bind(this), false);
  },

  mapObject.handleYearSelection = function() {
    mapObject.popup.setPosition(undefined);
    mapObject.countryHightlightLayer.getSource().forEachFeature(function(feature) {
      mapObject.countryLayer.getSource().addFeature(feature);
    });
    mapObject.countryHightlightLayer.getSource().clear();

    var isAll = $(mapObject.yearSelector).val() == 'All';
    mapObject.markerHoldingLayer.getSource().forEachFeature(function(iFeature) {
      mapObject.markerLayer.getSource().addFeature(iFeature);
    });
    mapObject.markerHoldingLayer.getSource().clear();
    mapObject.markerLayer.getSource().forEachFeature(function(iFeature) {
      if (!isAll && $(mapObject.yearSelector).val() != iFeature.get('when_endorsed')) {
        mapObject.markerLayer.getSource().removeFeature(iFeature);
        mapObject.markerHoldingLayer.getSource().addFeature(iFeature);
      }
    });
  };
mapObject.clickHandler = function(evt) {
  var feature = mapObject.map.forEachFeatureAtPixel(
    evt.pixel,
    function(ft, layer) {
      if (layer == mapObject.markerLayer) {
        return ft;
      }
    }
  );
  if (feature) {
    mapObject.countryHightlightLayer.getSource().forEachFeature(function (feature) {
      mapObject.countryLayer.getSource().addFeature(feature);
    });
    mapObject.countryHightlightLayer.getSource().clear();

    var content =
    '<div class="card map-popup" style="bottom: -9rem; padding: 0">' +
    '<h6 class="card-header p-2">' + feature.get("name") + '</h6>' +
    '<p class="text-muted mt-2 ml-2 mb-0"><a href="http://' + feature.get("website") + '">' + feature.get('website') + '</a></p>' +
    '<p class="text-muted mt-2 ml-2 mb-0">Endorser since ' + feature.get("when_endorsed") + '</p>' +
    '<p class="text-muted mt-2 ml-2 mb-2"><a href="/organizations/' + feature.get("id") + '"><small>View organization</small></a></p>' +
    '</div>';

    console.log(feature);

    feature.get('countries').forEach(function(cLabel) {
      mapObject.countryLayer.getSource().forEachFeature(function(cFeature) {
        if (cLabel == cFeature.get('name')) {
          mapObject.countryHightlightLayer.getSource().addFeature(cFeature);
        }
      });
    });
    mapObject.countryHightlightLayer.getSource().forEachFeature(function (feature) {
      mapObject.countryLayer.getSource().removeFeature(feature);
    });

    var element = mapObject.popup.element;
    $(element).html(content);
    mapObject.popup.setPosition(feature.get("coordinate"));
  } else {
    mapObject.popup.setPosition(undefined);
    mapObject.countryHightlightLayer.getSource().forEachFeature(function (feature) {
      mapObject.countryLayer.getSource().addFeature(feature);
    });
    mapObject.countryHightlightLayer.getSource().clear();
  }
};
